					'é': 'E',
					'ê': 'E',
					'ë': 'E',
					'ì': 'I',
					'í': 'I',
					'î': 'I',
					'ï': 'I',
					'ñ': 'N',
					'ò': 'O',
					'ó': 'O',
					'ô': 'O',
					'ö': 'O',
